$('#topdf').click(function() {
		
		 var doc = new jsPDF();
		 var imgData = 'data:image/jpeg;base64,';
		 
		 doc.addImage(imgData, 'JPEG',0,0,210,297);
		 
		var boa = $('#boardtext').text();
        var proc = $('#procetext').text();
        var memo = $('#memoriatext').text();
        var grafica = $('#graficatext').text();
        var fuente = $('#fuentetext').text();
        var solido = $('#solidotext').text();
		var mecanico = $('#mecanicotext').text();
		var disipador = $('#disipaciontext').text();
        var monitores = $('#monitortext').text();
        var chasis = $('#chasistext').text();
        var total = $('#total').text();
		
		doc.setFontSize(13);
		doc.setTextColor(92, 76, 76);
		
		doc.text(10, 55, boa);
		doc.text(10, 75, proc);
		doc.text(10, 98, memo);
		doc.text(10, 120, grafica);
        doc.text(10, 140, fuente);
        doc.text(10, 162, solido);
        doc.text(10, 185, mecanico);
        doc.text(10, 203, disipador);
        doc.text(10, 230, monitores);
        doc.text(10, 252, chasis);
    
        doc.setFontSize(30);
		doc.setTextColor(33, 102, 36);
    
        doc.text(43, 270, total);
		doc.save('Cotizacion.pdf');

	});